INSERT INTO `v1_fc7cf762b18c80c2c3f2d5fdb909a807ff43a12a68588aadb3be44a05a3cd4da` VALUES (1110501052, 1, "是非もなし。\n端的に言えば、先輩ちょっと感激した。\n今宵は飲めや食えやの大騒ぎだ。\n朝まで踊り明かすぜ同志、ヒャッハー！", 1110501, 11, 0, 1, 111011, 0, "", 5);
